import { Autocomplete, Grid, Icon, TextField } from "@mui/material";
import { IMovie } from "../interfaces/movieInterface";
import movieImage from "../images/movieIMG.jpeg";
export const SearchBar = () => {
  const [suggestions, setSuggestions] = useState();
  const [movieData, setMovieData] = useState<IMovie[]>([
    {
      id: 100,
      title: "Iron pony",
      description: "asdklfjsalkjdf",
      rating: 2,
      numberOfVotes: 1,
    },
    {
      id: 200,
      title: "Spaceglider",
      description: "space gliding monkeys",
      rating: 10,
      numberOfVotes: 3,
    },
  ]);

  const handleSelect = (event: any, value: any) => {
    console.log(value);
  };

  return (
    <>
      <Autocomplete
        freeSolo
        id="free-solo"
        disableClearable
        autoHighlight
        sx={{ width: 300 }}
        options={movieData}
        getOptionLabel={(option) => option.description}
        // renderOption={(props, option) => (
        //   <div style={{ cursor: "pointer" }}>
        //     <Grid container spacing={2}>
        //       <Grid item>
        //         <img src={movieImage} width="50px" height="50px" />
        //       </Grid>
        //       <Grid item spacing={0}>
        //         {option.title}
        //       </Grid>
        //     </Grid>
        //   </div>
        // )}
        renderOption={(props, option) => {
          return (
            <Fragment>
              {/* <Icon className={classes.icon}>
                        {
                            renderCorrectAccountChannelIcon(option.network_id)
                        }
                    </Icon> */}
              {option.title}
            </Fragment>
          );
        }}
        renderInput={(params) => (
          <TextField
            {...params}
            label="Movie"
            InputProps={{
              ...params.InputProps,
              type: "search",
            }}
          />
        )}
        onChange={(event, value) => handleSelect(event, value)}
      />
    </>
  );
};
